  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for DeSoto
  National Wildlife Refuge summarizes refuge activities during fiscal year 2000.  The
  report begins with an introduction to the refuge and a summary of the yearu2019s
  highlights and climatic conditions.  Information about monitoring and studies- including
  waterfowl, migratory birds, and fish surveys - is provided next.  Habitat restoration
  and management projects are also covered; activities include wetland and upland
  restoration, water level management, moist soil management, prescribed burning,
  and invasive plant control.  Fish and wildlife management is discussed next with
  emphasis on bird banding, disease monitoring, and predator control. Coordination
  activities, such as agency partnerships and private land activities are outlined.
  \ The resource protection section provides information about law enforcement and
  cultural resource management.  Information about public education and recreation
  is given including visitor services and outreach programs.  Finally, refuge planning
  and administration are discussed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
